import React from "react";
import styled from "styled-components";

// import { NavLink } from "react-router-dom";

export const Navbar: React.FC = () => (
  <nav>
    <div>
      <a href="/">
        Todo with Typescript
      </a>
      <ul>
        <li>
          <a href="/">Todo</a>
        </li>
        <li>
          <a href="/about">About</a>
        </li>
      </ul>
    </div>
  </nav>
);
